export class Copier {
    couldCopy;
    prepare;
    canCopy;
    copiedMonster;
    fightCopy = null;
    constructor(couldCopy, prepare, canCopy, copiedMonster, fightCopy) {
        this.couldCopy = couldCopy;
        this.prepare = prepare;
        this.canCopy = canCopy;
        this.copiedMonster = copiedMonster;
        if (fightCopy)
            this.fightCopy = fightCopy;
    }
}
